function subirpdf(){       
    var pdf2 = document.getElementById("pdf").files; 
    if (pdf2.length > 0) {   
        var fileToLoad = pdf2[0];            
        var fileReader = new FileReader();
        var base64;            
        fileReader.onload = function(fileLoadedEvent) {
            base64 = fileLoadedEvent.target.result;                
            sdidact(base64);
            };            
        fileReader.readAsDataURL(fileToLoad);  
    }          
    else
        alert("favor de seleccionar un archivo para subir.");
}


function sdidact(base64){
    var dato = "";
    var mes = "";
    let fecha = new Date();    
    dato = fecha.getDate();
    if(dato<10)
    dato="0" + dato;    
    mes = fecha.getMonth() + 1;
    if (mes < 10)
        mes = "0" + mes;
    dato = dato + '/' + mes + '/';    
    dato = dato + fecha.getFullYear();
    var npdf = $("#npdf").val();
    var idusuario = $("#idusuario").val();     
    if(base64.length > 1048576)
        alert("El pdf debe pesar 1 Mb o menos.");
    else if(npdf == "")
        alert("favor de escribir un nombre al archivo a subir.");
    else{
        var parametros = {
            "idusuario": idusuario,
            "dato": dato,
            "npdf": npdf,
            "base64": base64
            };
        $.ajax({
            method: 'POST',
            url: '../../libs/db/ssec.php',
            data: parametros,
            success: function(resp) {                             
                alert(resp);
                if(resp == "PDF Subido."){                                        
                    window.location.reload();
                }
            }
        });  
    } 
}

