function verificar(gmail){    
    var c= gmail.indexOf('@');    
    if(c != -1)
    {
        c= gmail.trim().length - 1;
        if(gmail[c-2] == "." || gmail[c-3] == "."){            
            return 1
        }        
    }    
    return 0;
}

